@-moz-document domain("syntax.eco") {

    body {
        background: #fff;
        -bs-body-bg: rgb(255, 255, 255) !important;
        -bs-body-color: #000;
        -bs-tertiary-bg: #c5c5c5;
        font-size: 12px;
    }

    .navbar-expand-lg .navbar-nav .nav-link {
        font-size: 13px;
        font-family: Arial, Helvetica, sans-serif;
        line-height: 20px;
        color: #fff;
        font-weight: 700;
        padding-left: 7px !important;
    }

    .nav-link:hover {
        background: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAAAiCAYAAACXxhNrAAAAJklEQVQoz2P8//+/AwMaYGFgYPhPtOA/eqmkm+DfEaydFoJ0STYA7VYkhL5utR0AAAAASUVORK5CYII=);
        background-size: contain;
    }

    .subnav-bar a {
        font-size: 12px;
        font-family: Arial, Helvetica, sans-serif;
        line-height: 20px;
        color: #fff !important;
        font-weight: 500;
        padding: 2px;
        position: relative;
        left: 16%;
    }

    .ps-3 {
        padding-left: 14rem!important;
    }

    .subnav-bar a:hover {
        background: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAAAiCAYAAACXxhNrAAAAJklEQVQoz2P8//+/AwMaYGFgYPhPtOA/eqmkm+DfEaydFoJ0STYA7VYkhL5utR0AAAAASUVORK5CYII=);
        background-size: contain;
        height: 50px;
    }

    .h1,
    h1 {
        font-size: 35px;
        font-family: Arial, Helvetica, sans-serif;
        color: black;
    }

    .form-floating > label {
        color: black !important;
    }

    p {
        font-family: Arial, Helvetica, sans-serif;
        color: #444242;
    }

    .container-main {
        margin-top: 60px;
        margin-left: 0!important
    }
    .content {
        background: transparent
    }
    .dark-theme .content {
        background: transparent
    }
    .light-theme .rbx-header,
    .dark-theme .rbx-header {
        border: 0
    }
    .btn-generic-more-sm,
    a.btn-generic-more-sm,
    button.btn-generic-more-sm,
    .btn-generic-more-sm:hover,
    button.btn-generic-more-sm:hover {
        background: none;
        border-radius: 0
    }

    .gotham-font,
    .gotham-font .h1,
    .gotham-font .h2,
    .gotham-font .h3,
    .gotham-font .h4,
    .gotham-font .h5,
    .gotham-font .h6,
    .gotham-font h1,
    .gotham-font h2,
    .gotham-font h3,
    .gotham-font h4,
    .gotham-font h5,
    .gotham-font h6,
    .gotham-font .text,
    .gotham-font body,
    .gotham-font button,
    .gotham-font html,
    .gotham-font input,
    .gotham-font pre,
    .gotham-font select,
    .gotham-font textarea {
        font-family: Arial
    }
    @font-face {
        font-family: 'Source Sans Pro';
        font-style: normal;
        font-weight: 400;
        src: local('Source Sans Pro'), local('SourceSansPro-Regular'), url(//themes.googleusercontent.com/static/fonts/sourcesanspro/v5/ODelI1aHBYDBqgeIAH2zlBM0YzuT7MdOe03otPbuUS0.woff) format('woff')
    }
    @font-face {
        font-family: 'Source Sans Pro';
        font-style: normal;
        font-weight: 600;
        src: local('Source Sans Pro Semibold'), local('SourceSansPro-Semibold'), url(//themes.googleusercontent.com/static/fonts/sourcesanspro/v5/toadOcfmlt9b38dHJxOBGJ6-ys_j0H4QL65VLqzI3wI.woff) format('woff')
    }
    @font-face {
        font-family: 'Source Sans Pro';
        font-style: normal;
        font-weight: 700;
        src: local('Source Sans Pro Bold'), local('SourceSansPro-Bold'), url(//themes.googleusercontent.com/static/fonts/sourcesanspro/v5/toadOcfmlt9b38dHJxOBGFkQc6VGVFSmCnC_l7QZG60.woff) format('woff')
    }
    .modal-open-noscroll {
        overflow-y: scroll
    }

    .navbar-collapse .navbar-nav.nav-item.nav-link {
        font-size: 0;
        font-family: Arial, Helvetica, sans-serif;
        line-height: 20px;
        color: #fff;
        font-weight: 700
    }

    .container-fluid {
        max-width: 970px
    }

    .navbar {
        border-bottom: none;
        -bs-navbar-padding-y: 0.1rem;
        background: #114081 url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAAAkCAIAAADO/WchAAAAUElEQVQoz2OUDFrGgARYGP7/R+YzMaAClv8M//GpZ2HAkGcgIP+PNPMJ2PcfQ/4fSeb9J+A+wv5Fd88/ktST7B785mHEH0HzCcTfj8eHkfkALG07/GmqG6wAAAAASUVORK5CYII=) repeat-x;
        height: 36px
    }

    .subnav-bar {
        background-color: #1b1d1d;
        -padding-left: 31rem!important;
    }

    .border-bottom {
        border-bottom: none !important;
    }

    .navbar-brand h1 {
        font-weight: 1000;
        background-image: url(data:image/png;base64,);
        color: transparent;
        max-width: 120px;
        height: 34px;
        padding-left: 12px;
        user-select: none;
        font-size: 1.6rem;
    }

    .navbar-brand h1:hover {
        background-position-y: 35px
    }

    .navbar-expand-lg .navbar-nav .nav-link {
        padding-left: 1rem;
    }

    img.rounded-5.overflow-hidden.me-2 {
        display: none;
    }

    .rbx-icon-nav-robux {
        background: no-repeat url(data:image/png;base64,)0 0;
        background-position-y: -79px;
        width: 20px;
        height: 20px;
        position: relative;
        left: 20%;
        top: 6%;
    }

    .rbx-icon-nav-tix {
        background: no-repeat url(data:image/png;base64,)0 0;
        background-position-y: -119px;
        width: 20px;
        height: 20px;
        position: relative;
        left: 35%;
        top: 6%;
    }

    #currencydiv .nav-link {
        background: no-repeat url(data:image/png;base64,)0 0;
        background-position-y: -158px;
        width: 20px;
        height: 20px !important;
        position: relative;
        top: 6%;
    }

    .rbx-icon-nav-settings {
        background: none;
    }

    .gamelaunch-btn {
        background: url(data:image/png;base64,) no-repeat;
        color: transparent;
        height: 54px;
        width: 210px !important;
        border-color: transparent;
        position: relative;
        left: 20%;
    }

    .gamelaunch-btn:hover {
        background-position-y: -54px;
        color: transparent;
        border-color: transparent;
        position: relative;
    }

    .rbx-icon-nav-settings:hover {
        background: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAAAiCAYAAACXxhNrAAAAJklEQVQoz2P8//+/AwMaYGFgYPhPtOA/eqmkm+DfEaydFoJ0STYA7VYkhL5utR0AAAAASUVORK5CYII=)0 0;
        background-size: 20px;
        padding-left: 33px;
        position: relative;
        right: 10px;
        bottom: 10px;
    }

    #currencydiv span {
        font-size: 1rem;
    }

    .place-card {
        background-color: transparent;
        min-height: 220px;
        transition: 99s;
        width: 150px;
        border-radius: 0px;
        box-shadow: 0 0 0px rgb(0, 0, 0);
    }

    .rounded {
        background-color: transparent !important;
        box-shadow: 0 0 0px rgb(0, 0, 0);
    }

    .h4,
    h4 {
        color: #494949;
    }

    .container,
    .container-lg,
    .container-md,
    .container-sm,
    .container-xl,
    .container-xxl,
    .card-container,
    .settings-container,
    .nav-link-active,
    .place-card-container {
        background: url(https://www.roblox.com/images/cssspecific/rbx2/standardBox_01_bkg.png) top repeat-x #fff;
        border: 1px solid #aaa;
        background-color: transparent !important;
        box-shadow: 0 0 0px;
        border-color: #444;
        border-radius: 3px;
        border-style: solid;
        border-width: thin;
    }

    #currencydiv:before {
        content: "13+";
        font: normal 10px arial;
        color: #d7d7d7;
        position: relative;
        right: 3px;
        top: 7px;
    }

    .page-tabs a {
        color: #626262 !important;
        font-size: medium;
        margin-top: 5px;
        margin-bottom: 8px;
        font-weight: 500;
        text-decoration: none;
        width: 100%;
        text-align: center;
        display: block;
        padding: 8px;
        background-color: rgba(0, 0, 0, 0);
        border-radius: 3px;
        border-style: solid;
        border-width: 1px;
        box-shadow: 0 0 0px;
    }

    .page-tabs a:hover {
        color: #000 !important;
        margin-top: 5px;
        margin-bottom: 8px;
        text-decoration: none;
        width: 100%;
        text-align: center;
        display: block;
        padding: 8px;
        background-color: rgba(0, 0, 0, 0);
        border-radius: 3px;
        border-style: solid;
        border-width: 1px;
        box-shadow: 0 0 0px;
    }

    b {
        color: var(--bs-body-color);
    }

    .h1,
    .h2,
    .h3,
    .h4,
    .h5,
    .h6,
    h1,
    h2,
    h3,
    h4,
    h5,
    h6 {
        color: var(--bs-body-color);
    }

    div.fw-bold.bg-dark.text-white {
        color: white !important;
    }

    a.btn.btn-sm.border-primary.text-white {
        color: white !important;
    }

    .dark-container {
        border-color: black;
        border-radius: 3px;
        border-style: solid;
        border-width: 1px;
    }

    .dropdown-menu.show {
        display: block;
        border-color: black;
        border-radius: 3px;
        border-style: solid;
        border-width: 1px;
    }

    .p-1 {
        background-color: transparent !important;
        border-color: black;
        border-radius: 3px;
        border-style: solid;
        border-width: 1px;
        box-shadow: 0 0 0px !important;
    }

    div.w-100.m-2.p-2 {
        background-color: transparent !important;
    }

    .mt-3.rounded-top.mb-2 {
        display: inline !important;
    }

    .mt-4.m-2.rounded-top {
        display: inline !important;
    }

    .asset-card-button {
        background-color: #0c85ca !important;
        color: #fff !important;
    }

    #nav-about-tab {
        color: black !important;
        font: bold 13px arial;
        border-color: black;
        border-radius: 3px;
        border-style: solid;
        border-width: 1px;
    }

    #nav-games-tab {
        color: black !important;
        border-color: black;
        font: bold 13px arial;
        border-radius: 3px;
        border-style: solid;
        border-width: 1px;
    }

    #nav-servers-tab {
        color: black !important;
        font: bold 13px arial;
        border-color: black;
        border-radius: 3px;
        border-style: solid;
        border-width: 1px;
    }

    #nav-store-tab {
        color: black !important;
        border-color: black;
        font: bold 13px arial;
        border-radius: 3px;
        border-style: solid;
        border-width: 1px;
    }

    .table-dark {
        -bs-table-color: #fff;
        -bs-table-bg: transparent;
        -bs-table-border-color: transparent;
        -bs-table-striped-bg: transparent;
        -bs-table-striped-color: transparent;
        -bs-table-active-bg: transparent;
        -bs-table-active-color: transparent;
        -bs-table-hover-bg: transparent;
        -bs-table-hover-color: #fff;
        color: var(--bs-table-color);
        border-color: black;
        border-radius: 3px;
        border-style: solid;
        border-width: 1px;
    }

    td {
        color: black;
    }

    .table-striped > tbody > tr:nth-of-type(odd) > * {
        color: black;
    }

    th {
        color: black;
    }

    .text-decoration-none {
        background-color: transparent;
        font: bold 12px arial;
        color: black;
    }

    .border-primary {
        background-color: #2a7e4b;
    }

    .border-primary:hover {
        background-color: #299152;
    }

    .text-white {
        -bs-text-opacity: #fff;
        color: rgba(var(--bs-white-rgb), var(--bs-text-opacity))!important;
    }

    #file {
        -bs-text-opacity: #fff;
        color: rgba(var(--bs-white-rgb), var(--bs-text-opacity))!important;
    }

    .place-card {
        display: inline-block;
        color: transparent;
        font: bold 12px arial;
        margin: 0;
        max-height: 5px !important;
    }

    .text-decoration-none {
        max-height: 205px !important;
    }

    .mb-0 {
        display: inline-block;
        color: #095fb5;
    }

    .mb-1 {
        color: #095fb5;
    }

    .place-card .votePercentageBackground {
        display: none;
    }

    .text-secondary {
        display: inline-block;
        color: rgb(26, 26, 26) !important;
        font: normal 12px arial;
    }

    .category-list a {
        border-color: black;
        border-radius: 3px;
        border-style: solid;
        border-width: 1px;
        box-shadow: 0 0 0px;
        background-color: transparent;
        color: black;
    }

    .category-list a.selected {
        background-color: rgb(58, 58, 58);
        color: white;
        border-color: black;
        border-radius: 3px;
        border-style: solid;
        border-width: 1px;
        box-shadow: 0 0 0px;
    }

    .category-list a:hover {
        box-shadow: 0 0 0px;
        background-color: transparent;
        color: black;
    }

    #footer {
        border-top: 1px solid rgb(255, 255, 255);
        background-color: rgb(255, 255, 255);
        min-height: 100px;
    }

    #footerlist a {
        display: flex;
        width: 100%;
        text-decoration: none !important;
        color: rgb(39, 39, 39) !important;
        font-weight: 400 !important;
        transition: 0.2s;
    }

    .form-control:disabled ~ label {
        color: black !important;
    }

    .btn-outline-light {
        -bs-btn-color: #090909;
        -bs-btn-border-color: #f8f9fa;
        -bs-btn-hover-color: #000;
        -bs-btn-hover-bg: #f8f9fa;
        -bs-btn-hover-border-color: #f8f9fa;
        -bs-btn-focus-shadow-rgb: 248, 249, 250;
       -bs-btn-active-color: #000;
        -bs-btn-active-bg: #262728;
        -bs-btn-active-border-color: #0c0c0d;
        -bs-btn-active-shadow: inset 0 3px 5px rgba(0, 0, 0, 0.125);
        -bs-btn-disabled-color: #f8f9fa;
        -bs-btn-disabled-bg: transparent;
        -bs-btn-disabled-border-color: #f8f9fa;
        -bs-gradient: none;
        border-color: black;
        border-radius: 3px;
        border-style: solid;
        border-width: 1px;
    }

    #exchange-currency-type {
        color: black !important;
        background-color: white !important;
    }

    .align-items-center {
        align-items: center !important;
        justify-content: center;
    }

    .card-container {
        justify-content: center;
    }
}
